import { Lock, Mail, UserRound } from 'lucide-react'
import { Link } from 'react-router-dom'
import '../components/FormValidation.js'

import CustomForm from '../styles/CustomForm.module.css'
import styles from '../styles/RegistrationLogin.module.css'

export function Registration() {
	const [Email, setEmail] = useState('')
	const [Password, setPassword] = useState('')
	const [RePassword, setRePassword] = useState('')
	const [First_Name, setFirst_Name] = useState('')
	const [Last_Name, setLast_Name] = useState('')
	const [FormValid, setFormValid] = useState(false)

	const [EmailDirty, setEmailDirty] = useState(false)
	const [PasswordDirty, setPasswordDirty] = useState(false)
	const [RePasswordDirty, setRePasswordDirty] = useState(false)
	const [First_NameDirty, setFirst_NameDirty] = useState(false)
	const [Last_NameDirty, setLast_NameDirty] = useState(false)

	const [EmailError, setEmailError] = useState('Email не може бути пустим')
	const [PasswordError, setPasswordError] = useState(
		'Password не може бути пустим'
	)
	const [RePasswordError, setRePasswordError] = useState(
		'RePassword не може бути пустим'
	)
	const [First_NameError, setFirst_NameError] = useState(
		'First_Name не може бути пустим'
	)
	const [Last_NameError, setLast_NameError] = useState(
		'Last_Name не може бути пустим'
	)
	return (
		<div className={styles.Container}>
			<div className={styles.RightBlock}></div>

			<div className={styles.LeftBlock}>
				<div className={styles.RegForm}>
					<div className={styles.RegFormLine}></div>
					<form action=''>
						<h1 className={styles.RegFormHeader}>Registration Form</h1>
						{EmailDirty && EmailError && (
							<div style={{ color: 'red' }}>{EmailError}</div>
						)}
						<div className={styles.RegFormBlock}>
							<Mail />
							<input
								className={CustomForm.CustomInput}
								type='Email'
								name='Email'
								value={Email}
								placeholder='Email'
								onBlur={e => blurHandler(e)}
								onChange={e => EmailHandler(e)}
							/>
						</div>
						{PasswordDirty && PasswordError && (
							<div style={{ color: 'red' }}>{PasswordError}</div>
						)}
						<div className={styles.RegFormBlock}>
							<Lock />
							<input
								className={CustomForm.CustomInput}
								type='Password'
								name='Password'
								value={Password}
								onBlur={e => blurHandler(e)}
								onChange={e => PasswordHandler(e)}
								placeholder='Password'
							/>
						</div>
						<div className={styles.RegFormBlock}>
							<Lock />
							<input
								className={CustomForm.CustomInput}
								type='Password'
								name='RePassword'
								value={RePassword}
								onChange={e => setRePassword(e.target.value)}
								placeholder='Re-type password'
							/>
						</div>

						<div className={styles.RegFormBlockNames}>
							<div className={styles.RegFormBlock}>
								<UserRound />
								<input
									className={CustomForm.CustomInput}
									type='text'
									name='First_Name'
									value={First_Name}
									onChange={e => setFirst_Name(e.target.value)}
									placeholder='First Name'
								/>
							</div>
							<span className={styles.MarginNames}></span>
							<div className={styles.RegFormBlock}>
								<UserRound />
								<input
									className={CustomForm.CustomInput}
									type='text'
									name='Last_Name'
									value={Last_Name}
									onChange={e => setLast_Name(e.target.value)}
									placeholder='Last Name'
								/>
							</div>
						</div>

						<div className={styles.RegFormBlock}>
							<div>
								<input type='checkbox' id='conditions1' name='conditions' />
								<label>I agree with terms and conditions</label>
							</div>
						</div>
						<div className={styles.RegFormBlock}>
							<div>
								<input type='checkbox' id='conditions' name='conditions' />
								<label>I want to receive the newsletter</label>
							</div>
						</div>

						<div className={styles.RegFormBlock}>
							<button
								disabled={!FormValid}
								className={CustomForm.CustomButtonSubmit}
							>
								Register
							</button>
						</div>
					</form>
					<div className={styles.AfterForm}>
						<Link to={'/Login'}> Already have an account? </Link>
					</div>
				</div>
			</div>
		</div>
	)
}
